import React from 'react';
import {BrowserRouter} from 'react-router-dom'
import './App.css';
import Nav from './container/Nav'
import Content from './container/Content'

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <header className="App-header">
          <Nav/>

        </header>
        <Content/>
      </div>
    </BrowserRouter>

  );
}

export default App;
